text:
Happy Thanksgiving to all!
Especially #Thankful for all our Armed Forces members! And for the hospitality of the @USCoastGuard (LA/LB) and their assistance in making this holiday message.
@USArmy @USMC @USNavy @USAirForce https://t.co/5HjQ4xtpyG

Today, let us be...

Thankful for God who loves us and offers forgiveness;

Thankful for family and friends;

Thankful to be in the greatest Country on Earth; and

Thankful for a strong President and promise-keeper, @realDonaldTrump.

#HappyThanksgiving! https://t.co/4YTLlbRZxp
